description:
reformat of: NobodyExistsOnTheInternet/ToxicDPOqa for llama-factory DPO format
usage example:
  "toxic_dpo_reformat": {
    "hf_hub_url": "lucyknada/NobodyExistsOnTheInternet_ToxicDPOqa_llama_factory",
    "ranking": true,
    "columns": {
      "prompt": "prompt",
      "response": "response",
      "system": "system"
    }
  },

The JSON file structure of data from one topic is as follows:
{
  "max_scores" : [list of numbers] ,
  "attempts" : [
    {
      "id " : str,
      "records" : [list of lists of numbers],
    }
  ]
}

where:
• max_scores: The length of the list is the number of questions of the topic, and the value of each
element is the maximum score for a question,
• attempts: List of student attempts.
• id: Student ID
• records: The length of the outer list is the number of questions of the topic, the… See the full description on the dataset page: https://huggingface.co/datasets/ura-hcmut/dsa-lab-data.
